import React from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const navigate = useNavigate();

  const menuItems = [
    { title: 'My Cart', path: '/cart', icon: 'üõí' },
    { title: 'Order History', path: '/orders', icon: 'üìã' },
    { title: 'Nearby Stores', path: '/stores', icon: 'üè™' },
    { title: 'Profile', path: '/profile', icon: 'üë§' },
  ];

  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-6">Welcome to Smart Cart</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
        {menuItems.map((item) => (
          <div
            key={item.path}
            className="bg-white p-6 rounded-lg shadow-md hover:shadow-lg cursor-pointer transition-shadow"
            onClick={() => navigate(item.path)}
          >
            <div className="text-4xl mb-4">{item.icon}</div>
            <h2 className="text-xl font-semibold">{item.title}</h2>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
